import 'App.css';
import 'bootstrap/dist/css/bootstrap.css'
import {Nav, Navbar, NavDropdown} from 'react-bootstrap'

export default function Navbars() {

    function Damo() {
        var element = document.body;
        element.classList.toggle("dark-mode");
    
    }
    return (        
        <Navbar bg='navbar' variant='dark'>     

        <Nav>
        <Nav.Link href='/'>Kezd≈ëlap</Nav.Link>

          <NavDropdown title="Algo2" className='navbtn'>
            <NavDropdown.Item href='algo2/'>1</NavDropdown.Item>
            <NavDropdown.Item href='algo2/'>1</NavDropdown.Item>
          </NavDropdown>

          <NavDropdown title="Opkut" className=''>
            <NavDropdown.Item href='opkut/'>1</NavDropdown.Item>
            <NavDropdown.Item href='opkut/'>1</NavDropdown.Item>
          </NavDropdown>
          
          <Nav.Link href='/'>Login</Nav.Link>

          <button class="damo" onClick={Damo}>Damo</button>
          
        </Nav>
      </Navbar>
    )    
}
